import React from 'react';
import PropTypes from 'prop-types';
import Slider from '@mui/material/Slider';

const Jouster = () => {

  const [strength, setStrength] = React.useState(5);
  const [luck, setLuck] = React.useState(5);
  const [dexterity, setDexterity] = React.useState(5);
  const [name, setName] = React.useState('');
  function valuetext(value) {
    return `${value}°C`;
  }
  return (
    <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-standard-label">Strength</InputLabel>
        <Slider
          aria-label="Strength"
          defaultValue={strength}
          getAriaValueText={valuetext}
          valueLabelDisplay="auto"
          step={1}
          marks
          min={10}
          max={1}
        />
    </FormControl>
  )
};

Jouster.propTypes = {};

Jouster.defaultProps = {};

export default Jouster;
